import React, { useState } from 'react';
import homeImg from '../../home.png'; 
import profileImg from '../../profile.png'; 
import writeImg from '../../write.png'; 
import searchImg from '../../search.png'; 
import profileimgImg from '../../profileimg.png';
import { Link } from 'react-router-dom';

function HomePage() {
    const [cards, setCards] = useState([
        { id: 1, nickname: '닉네임1', recipeName: '요리 이름1', image: profileimgImg },
        { id: 2, nickname: '닉네임2', recipeName: '요리 이름2', image: profileimgImg },
        { id: 3, nickname: '닉네임3', recipeName: '요리 이름3', image: profileimgImg },
        { id: 4, nickname: '닉네임4', recipeName: '요리 이름4', image: profileimgImg },
        { id: 2, nickname: '닉네임5', recipeName: '요리 이름5', image: profileimgImg },
        { id: 3, nickname: '닉네임6', recipeName: '요리 이름6', image: profileimgImg }
    ]);

    // 카드를 행 단위로 나누기
    const rows = [];
    for (let i = 0; i < cards.length; i += 2) {
        rows.push(cards.slice(i, i + 2));
    }

    return (
        <div className='container2'>
            <div className='title-box-home'>
                <h1 className='ft-big'>나의 취향저격 레시피</h1>
            </div>
            <div className='search'>
                <img src={searchImg} className='search-img'/>
                <input 
                className='search-box' 
                type='text' 
                placeholder='         레시피 검색하기'
                />
            </div>
            <div className="container3">
                {rows.map((row, rowIndex) => (
                    <div className="row" key={rowIndex}>
                        {row.map(card => (
                            <Card 
                                key={card.id}
                                nickname={card.nickname} 
                                recipeName={card.recipeName} 
                                image={card.image} 
                            />
                        ))}
                    </div>
                ))}
            </div> 

            <nav>
                <Link to={'/home'}><div>
                    <img src={homeImg} alt="홈" />
                    <p>홈</p>
                </div></Link>
                <Link to={'/my'}><div>
                    <img src={profileImg} alt="MY" />
                    <p>MY</p>
                </div></Link>
                <Link to={'/write'}><div>
                    <img src={writeImg} alt="글쓰기" />
                    <p>글쓰기</p>
                </div></Link>
            </nav>
        </div>
    );
}

function Card({ nickname, recipeName, image }) {
    return (
        <div className="col-md-5">
            <button className='card'>
                <div className='card-profile'>
                    <img src={profileimgImg} className='profileimg-img'/>
                    <p className='ft-card'>{nickname}</p>
                </div>
                <img src={image} className='card-img'/>
                <div className='card-name'>
                    <p className='ft-card-small'>{recipeName}</p>
                </div>
            </button>
        </div>
    );
}

export default HomePage;
